import React, { Component, PropTypes } from 'react';
import Header from './HeaderComponent.jsx';

const propTypes = {
  children: PropTypes.object.isRequired
};

function AppPage(props) {
  return (
    <div>
      <Header />
      {this.props.children}
    </div>
  );
}

AppPage.propTypes = propTypes;

export default AppPage;
